    "\n",
    "#Square the number inputed\n",
    "squared_value = number ** 0.5\n",
    "\n",
    "# Round the number to 1 decimal place\n",
    "roundednumber = round(squared_value, 1)\n",
    "\n",
    "# Print the square root value to one decimal place\n",
    "print(f\"The square root of {number} is aproximately {roundednumber}.\")\n",
    "\n",
