    "# create variable for Es in text file\n",
    "\n",
    "    #set variable to 0    \n",
    "E = 0\n",
    "\n",
    "    #increase variable everytime a lower or upper case E charcter is read\n",
    "for char in contents:\n",
    "    if char == 'E' or char == 'e':\n",
    "        E = E+1\n",
    "\n",
    "# tell user how Es are in the file\n",
    "print(f\"File contains {E} number of 'E's.\")\n",
